// import style from "./style.module.scss";
import Link from "next/link";

const NavBar = () => {
  return (
    <nav className="NavBar">
      <Link href="/">
        <a className="test">Home</a>
      </Link>
      <Link href="/about">
        <a>About</a>
      </Link>
      <Link href="/results">
        <a>Results</a>
      </Link>
      <Link href="/sign-up">
        <a>Sign Up</a>
      </Link>
      <style jsx>{`
        nav.NavBar {
          margin: 30px;
        }
        a {
          text-decoration: none;
          color: red;
          margin-right: 16px;
        }
        .test {
          color: blue;
        }
      `}</style>
    </nav>
  );
};

export default NavBar;
